  const data = [
    {
      id: "2",
      name: "Image Generator",
      desc: "ÈõÜÁµêÈÅéÂæÄ‰ΩøÁî® Vanilla JavaScript ÊâÄÁ∑¥ÁøíÊí∞ÂØ´ÁöÑÊúâË∂£Â∞èÈÅäÊà≤ÔºåHAVE FUN!",
      img: img2,
    },
    {
      id: "3",
      name: "Arcade Gameüëæ",
      desc: "ÈõÜÁµêÈÅéÂæÄ‰ΩøÁî® Vanilla JavaScript ÊâÄÁ∑¥ÁøíÊí∞ÂØ´ÁöÑÊúâË∂£Â∞èÈÅäÊà≤ÔºåHAVE FUN!",
      img: img3,
    },
  ];

  return (
    <div id="projects">
      <div className="section_title">
        <h1>Projects</h1>
      </div>
      <div className="section_container">
        <div className="project">
          {data.map((d) => (
            <div className="item">
              <div className="info">
                <h1>0{d.id}. </h1>
                <h2>{d.name}</h2>
                <p>{d.desc}</p>
                <div className="links">
                  <a
                    href="https://cching01099.github.io/ArcadeGame/"
                    target="_blank"
                    class="link"
                  >
                    <i class="fa-solid fa-globe"></i>site
                  </a>
                  <a
                    href="https://github.com/cching01099/ArcadeGame"
                    target="_blank"
                    class="link"
                  >
                    <i class="fa-brands fa-github"></i>repo
                  </a>
                </div>
              </div>
              <div className="image">
                <img src={d.img} alt="" />
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Projects;
